import React from "react";
import "./Header.scss";

const Header = () => {
	return (
		<header>
			<div className="headerInner">
				<a className="logo" href="/">
					<img src="" alt="" />
					<div className="logo-text">Academy</div>
				</a>
				<nav>
					<ul>
						<li>
							<a href="/">探索</a>
						</li>
					</ul>
				</nav>
				<div className="person-box">
					<div className="language"></div>
					<div className="avatar"></div>
				</div>
			</div>
		</header>
	);
};

export default Header;
